import React, { useState } from "react";
import Youtube from "react-youtube";

const TrailerMovie = (props) => {
  const [hasVideo, setHasVideo] = useState(false);
  const [getTrailer, setGetTrailer] = useState();

  return;
};

export default TrailerMovie;
